svg.script:

// Format a number over a 2-digit string (7 => 07)
function FormatNumber(n){
    return n > 9 ? "" + n: "0" + n;
}

// Time out to wait
function sleep(ms) {
  return new Promise(resolve => setTimeout(resolve, ms));
}

function ShowPendulumFrame(n){
  element = document.getElementById(FormatNumber(n));
  paths = element.querySelectorAll("path");
  for (var i = 0; i < paths.length; i++) {
    paths[i].setAttribute("display", "");
  }
}

function HidePendulumFrame(n){
  element = document.getElementById(FormatNumber(n));
  paths = element.querySelectorAll("path");
  for (var i = 0; i < paths.length; i++) {
    paths[i].setAttribute("display", "none");
  }
}

function ShowEpFrame(n){
  element = document.getElementById("p" + FormatNumber(n));
  paths = element.querySelectorAll("path");
  for (var i = 0; i < paths.length; i++) {
    paths[i].setAttribute("display", "");
  }
}

function HideEpFrame(n){
  element = document.getElementById("p" + FormatNumber(n));
  paths = element.querySelectorAll("path");
  for (var i = 0; i < paths.length; i++) {
    paths[i].setAttribute("display", "none");
  }
}

// Async is requiered for time out to work
async function click(evt) {
  //alert(document.getElementById("Background"));
  var svgDocument = evt.target.ownerDocument;
  var svgRoot = svgDocument.documentElement;

  // hide all frames
  var group;
  for (group = 1; group < 26; group++) {
    HidePendulumFrame(group);
    HideEpFrame(group);
  }

  // animate frames
  group = 1;
  ShowPendulumFrame(group);
  ShowEpFrame(group);
  await sleep(100);
  for (group = 2; group < 26; group++) {
    HidePendulumFrame(group-1);
    ShowPendulumFrame(group);

    ShowEpFrame(group);
    await sleep(100);
  }
};
